import React from "react";
import { Text, View, StyleSheet, Image } from "react-native";
// import { Image } from "@rneui/themed";
export default function InfoMovie() {
  return (
    <View style={{ marginTop: 50 }}>
      <Text>Yo Wahddddt shup</Text>
      <Image
        style={styles.poster}
        source={{
          uri: "https://www.thecosmiccircus.com/wp-content/uploads/2021/12/ds2-thumbnail-2-copy-e1648958806610.jpg",
        }}
      />
    </View>
  );
}

const styles = StyleSheet.create({
  item: {
    aspectRatio: 1,
    width: "100%",
    flex: 1,
  },
  poster: {
    height: 250,
  },
});
